package com.debanshu777.compose_github.network.model.userStats


import kotlinx.serialization.SerialName
import kotlinx.serialization.Serializable

@Serializable
data class Computed(
    @SerialName("avatar")
    val avatar: String = "", // data:image/png;base64,
    @SerialName("cakeday")
    val cakeday: Boolean = false, // false
    @SerialName("calendar")
    val calendar: List<Calendar> = listOf(),
    @SerialName("commits")
    val commits: Int = 0, // 1050
    @SerialName("diskUsage")
    val diskUsage: String = "", // 725 MB
    @SerialName("licenses")
    val licenses: Licenses = Licenses(),
    @SerialName("registered")
    val registered: Registered = Registered(),
    @SerialName("registration")
    val registration: String = "", // 3 years ago
    @SerialName("repositories")
    val repositories: Repositories = Repositories(),
    @SerialName("sponsorships")
    val sponsorships: Int = 0, // 0
    @SerialName("token")
    val token: Token = Token()
)